    fn get_key(self) -> Field {
        self.slot
    }

    fn get_next_key(self) -> Field {
        self.next_slot
    }

    fn as_leaf(self) -> Field {
        self.hash()
    }
}

impl PublicDataTreeLeafPreimage {
    pub fn is_empty(self) -> bool {
        (self.slot == 0) & (self.value == 0) & (self.next_slot == 0) & (self.next_index == 0)
    }
}

